import { Dialog } from "@material-ui/core";
import React from "react";
const CertificateDialog = (isOpenDialog) => {
  return <div>
    <Dialog 
    open={isOpenDialog}
    aria-labelledby="form-dialog-title"
    maxWidth={"md"}
    fullWidth={true}
    >

    </Dialog>
  </div>;
};
export default CertificateDialog;
